//序列化对象和数组
function serialize(data) {
  if(data != null && data != '') {
    try {
      return JSON.parse(JSON.stringify(data));
    } catch(e) {
      if(data instanceof Array) {
        return [];
      }
      return {};
    }
  }
  return data;
}


